  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130936 includes physical
  and profile data collected aboard NOAA LAUNCHES (RAINIER) during project OPR-0333-RA-15
  in the Coastal Waters of SE Alaska from 2015-05-04 to 2015-05-25. These data include
  CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and
  WATER TEMPERATURE. The instruments used to collect these data include CTD. These
  data were collected and submitted by the NOAA Office of Coast Survey in support
  of hydrographic multibeam surveys to meet NOAA charting requirements.\",\n\t\"license_title\":
